import './App.css';
import Product from './Components/Product/Product';

function App() {
  const products = [
    {
      name: 'ביסלי',
      price: '5.90',
      picture: 'bisli.png'
    },
    {
      name: 'במבה',
      price: '3.90',
      picture: 'bamba.png'
    },
  ];

  function renderProducts() {
    return products.map((product) => <Product product={product}/>);
  }

  return (
    <div className="App">
      <div className='products'>
        {renderProducts()}
      </div>
    </div>
  );
}

export default App;
